  \"2015-01-22T15:57:23.515482\",\n\t\"name\": \"assisted-housing-housing-choice-vouchers-by-tract\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Department of Housing and Urban
  Developmentu0092s (HUD) Housing Choice Voucher Program (HCVP) is the federal government's
  major program for assisting very low-income families, the elderly, and the disabled
  with decent, safe, sanitary and affordable housing in the private market. Since
  housing assistance is provided on behalf of the family or individual, participants
  are able to find their own housing, including single-family homes, townhouses and
  apartments. The participant is free to choose any housing that meets the requirements
  of the program and is not limited to units located in subsidized housing projects.
  Housing choice vouchers (HCV) are administered locally by public housing agencies
  (PHAs). The PHAs receive federal funds from HUD to administer the voucher program.
  A family that is issued a housing voucher is responsible for finding a suitable
  housing unit where the owner agrees to rent under the program. This unit may include
  the family's present residence. Rental units must meet minimum standards of health
  and safety, as determined by the PHA. A housing subsidy is paid to the landlord
  directly by the PHA on behalf of the participating family. The family then pays
  the difference between the actual rent charged by the landlord and the amount subsidized
  by the program. Under certain circumstances, if authorized by the PHA, a family
  may use its voucher to purchase a modest home.HCV locations are identified in public
  records by the owner and not the tenant so access to this information is restricted
  to help safeguard the location of HCV units. Due to the sensitive nature of the
  HCV locations, these are aggregated to the U.S. Census Bureauu0092s census tract
  geography.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
